import './Main.css';
import Intro from './Intro.js';

const Main = () => {
    return (
    <div class="Main">
        <div class="sec1">
        Login
        <div class="login">
          <input type="id" placeholder="ID" />
          <input type="password" placeholder="PASSWORD" />
          <input type="button" id = "bttn" value ="LOGIN"></input>
        </div>
        </div>
        <div class="sec2">Intro<Intro /></div>
        <div class="sec3">Upload</div>
        <div class="sec4">Option</div>
    </div>
    );
}

export default Main;
